import styled from 'styled-components/native';

export const Container = styled.View`
  margin: 0 20px;
  flex-direction: row;
  justify-content: center;
`;

export const InformProblem = styled.View`
  padding: 10px;
  width: 125px;
  display: flex;
  align-items: center;
  border: 1px solid #0000001a;
  background: #f8f9fd;
`;
export const ViewProblems = styled.View`
  padding: 10px;
  width: 125px;
  display: flex;
  align-items: center;
  border: 1px solid #0000001a;
  background: #f8f9fd;
`;
export const ConfirmDelivery = styled.View`
  padding: 10px;
  width: 125px;
  display: flex;
  align-items: center;
  border: 1px solid #0000001a;
  background: #f8f9fd;
`;

export const LabelText = styled.Text`
  padding-left: 15px;
  padding-bottom: 10px;
  font-size: 14px;
  color: #666;
  line-height: 26px;
`;
